  return (
    <div>
      <Navbar />
      <section className="text-center py-24 bg-gradient-to-r from-purple-600 to-blue-500 text-white">
        <h1 className="text-4xl md:text-6xl font-bold mb-4">Intelligence Behind Every Financial Move ðŸš€</h1>
        <p className="text-lg md:text-xl">Professional VCFO & startup growth solutions</p>
        <button className="mt-6 px-6 py-2 bg-white text-purple-700 font-semibold rounded shadow hover:bg-gray-100 transition">
          Book a Free Consultation
